import React, { Component } from 'react';
import '../styles/about.scss';

export class About extends Component {
    render() {
        return (
            <div className="about-container">
            <div className="textarea">

            <h2>About me</h2>

            <p>I’m Gabrielle Kamph, a 32 years old digital creative and front-end developer based in Stockholm, Sweden. <br/><br/>
            I have extensive experience within the field of digital marketing and a broad palette of skills such as content marketing, social media marketing, copywriting, project management, marketing automation and graphic design. <br /><br/>
            My career so far includes a wide range of roles, from generalist to specialist on both the agency and customer side, which has given me great experience to benefit from in future opportunities.<br/><br/>
            I’m currently studying front-end development at <a href="https://medieinstitutet.se/utbildningar/front-end-developer/">Medieinstitutet</a> to get cutting-edge knowledge in the field, graduating fall 2022. <br/><br/>
            My tech stack and knowledge within web development includes, but are not limited to, HTML, CSS/SASS, JavaScript, React, Node.js, mongoDB and of course Git and GitHub.
            <br/><br/>
            Don't hesitate to get in touch!</p>

            </div>
            </div>
        )
    }
}

export default About
